import React, { Component } from 'react'
import "./index.css"
export default class Item extends Component {
  render() {
    const { id,name,from,date } = this.props
    return (
      <div>
        <div className = "title-box">{id}.{name}</div>
        <div className="footer-bar">{from}{date}</div>
      </div>
    )
  }
}
